import React from 'react';
import logo from './mainlogo.jpg';
import './mainpage.css';

function MainPage() {
	var pic = "C:\Project\demo-react\src\mainlogo.jpg"
  return (
    <div className="MainPgae" style='--homeCardImage: {logo}'>
		<img src={logo} className="page-logo" alt="logo" />
		<div>Hello World</div>
    </div>
  );
}

export default MainPage;
